import React from 'react';

const sampleVideos = [
  { 
    title: "Usain Bolt Olympic Record", 
    duration: "00:13:20",
    thumbnail: "https://via.placeholder.com/300x200"
  },
  { 
    title: "Tennis Grand Slam Highlights", 
    duration: "00:01:14",
    thumbnail: "https://via.placeholder.com/300x200"
  },
  { 
    title: "Soccer World Cup Moment", 
    duration: "00:09:09",
    thumbnail: "https://via.placeholder.com/300x200"
  }
];

const VideoGrid = () => {
  return (
    <div>
      <div className="flex justify-between items-center mb-4">
        <div className="text-gray-600">
          Videos in sample_sports â€¢ 20 videos (Total 2h 16m)
        </div>
        <div className="text-gray-600">
          Index created on Jan 13, 2025
        </div>
      </div>

      <div className="grid grid-cols-3 gap-4">
        {sampleVideos.map((video, index) => (
          <div key={index} className="border rounded overflow-hidden">
            <img 
              src={video.thumbnail} 
              alt={video.title} 
              className="w-full h-48 object-cover" 
            />
            <div className="p-3">
              <div className="font-semibold text-sm truncate">{video.title}</div>
              <div className="text-xs text-gray-500">{video.duration}</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default VideoGrid;
